import axios from "axios";
import React, { useState } from "react";
import { City ,RightView,LeftViewToday} from "../Home/CityDTO";
// import {ReactComponent as Clock} from "./././images/clock.svg" ;
function Detail(props: any) {
  console.log(props);
  axios
    .get(
      `https://api.openweathermap.org/data/2.5/onecall?lat=${props.lat}&lon=${props.lon}&exclude=hourly,minutely,alerts&appid=e899757c1162bf7b2b2684a0b2b8f5cc`
    )
    .then((response) => console.log(response))
    .catch((error) => console.log(error));
  return (
    <div className="DetailView"> 
      <LeftView/>
      <RightView/>
      {props.location.state.lon}--{props.location.state.lat}
    </div>
  );
}

export default Detail;
